import React from "react";

export default function Section1({
  title,
  subtitle,
  dark,
  id,
  contact_text,
  img_src,
  pic1,
  pic2,
  pic3,
  pic4,
  pic5,
}) {
  return (
    <div className={"section1" + (dark ? " section1-dark" : "")}>
      <div className="section1-content" id={id}>
        <h1>{title}</h1>
        <img src={img_src} width="460"></img>
        <p className={"section1-text"} style={{ whiteSpace: "pre-line" }}>
          {subtitle}
          {"\n"}
          {contact_text}
        </p>
        <a href="https://github.com/mdeora25?tab=stars">
          <img
            className="icon"
            src={pic1}
            style={{ position: "absolute", top: "652px", right: 370 }}
            width="50px"
          ></img>
        </a>
        <a href="https://www.linkedin.com/in/mahip-deora/">
          <img
            className="icon"
            src={pic2}
            style={{ position: "absolute", top: "652px", right: 310 }}
            width="50px"
          ></img>
        </a>
        <a>
          <img
            className="icon"
            src={pic3}
            style={{ position: "absolute", top: "652px", right: 250 }}
            width="50px"
          ></img>
        </a>
        <a>
          <img
            className="icon"
            src={pic4}
            style={{ position: "absolute", top: "652px", right: 190 }}
            width="50px"
          ></img>
        </a>
        <a>
          <img
            className="icon"
            src={pic5}
            style={{ position: "absolute", top: "648px", right: 130 }}
            width="50px"
            height="60px"
          ></img>
        </a>
      </div>
    </div>
  );
}
